    DividendTracker public dividendTracker;
    address public rewardToken = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    uint256 public gasForProcessing = 300000;

    event ExcludeFromFees(address indexed account, bool isExcluded);
    event SwapEnabledUpdated(bool enabled);   
    event UpdateBuyFees(uint256 liquidityFeeOnBuy, uint256 marketingFeeOnBuy, uint256 rewardFeeOnBuy);
    event UpdateSellFees(uint256 liquidityFeeOnSell, uint256 marketingFeeOnSell, uint256 rewardFeeOnSell);
    event MarketingWalletChanged(address marketingWallet);   
    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);
    event SendMarketing(uint256 bnbSend);
    event UpdateUniswapV2Router(address indexed newAddress, address indexed oldAddress);
    event UpdateDividendTracker(address indexed newAddress, address indexed oldAddress);
    event GasForProcessingUpdated(uint256 indexed newValue, uint256 indexed oldValue);
    event SwapTokensAtAmountUpdated(uint256 swapTokensAtAmount);
    event SendDividends(uint256 amount);    
    event ProcessedDividendTracker(
        uint256 iterations,
        uint256 claims,
        uint256 lastProcessedIndex,
        bool indexed automatic,
        uint256 gas,
        address indexed processor
    );

    constructor() ERC20("Spongebob Inu", "Spongebob") {
        address newOwner = 0x20C9E801491D2DB90Fb1dbc40E8f2c6146f3d4B4;
        transferOwnership(newOwner);

        _mint(owner(), 100_000_000_000_000 * (10**18));
        swapTokensAtAmount = totalSupply() / 5000;

        dividendTracker = new DividendTracker((totalSupply() / 10**18) / 50000, rewardToken);

        address router;
        if (block.chainid == 56) {
            router = 0x10ED43C718714eb63d5aA57B78B54704E256024E; // BSC Pancake Mainnet Router
        } else if (block.chainid == 97) {
            router = 0xD99D1c33F9fC3444f8101754aBC46c52416550D1; // BSC Pancake Testnet Router
        } else if (block.chainid == 1 || block.chainid == 5) {
            router = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D; // ETH Uniswap Mainnet % Testnet
        } else {
            revert();
        }

        accumulatedBuybackBNB = 0;
        bnbValueForBuyBurn = 1 * (10**18);

        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(router);
        address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());

        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = _uniswapV2Pair;

        _approve(address(this), address(uniswapV2Router), type(uint256).max);

        pinkAntiBot = IPinkAntiBot(0x8EFDb3b642eb2a20607ffe0A56CFefF6a95Df002);
        pinkAntiBot.setTokenOwner(owner());
        antiBotEnabled = true;

        dividendTracker.excludeFromDividends(address(dividendTracker));
        dividendTracker.excludeFromDividends(address(this));
        dividendTracker.excludeFromDividends(DEAD);
        dividendTracker.excludeFromDividends(address(_uniswapV2Router));
        dividendTracker.excludeFromDividends(address(uniswapV2Pair));

        _isExcludedFromFees[owner()] = true;
        _isExcludedFromFees[DEAD] = true;
        _isExcludedFromFees[address(this)] = true;
    }

    receive() external payable {}

    function claimStuckTokens(address token) external onlyOwner {
        require(token != address(this), "Owner cannot claim native tokens");
        if (token == address(0x0)) {
            payable(msg.sender).transfer(address(this).balance);
            return;
        }
        IERC20 ERC20token = IERC20(token);
        uint256 balance = ERC20token.balanceOf(address(this));
        ERC20token.transfer(msg.sender, balance);
    }

    //=======FeeManagement=======//
     function excludeFromFees(address account, bool excluded) external onlyOwner {
        require(_isExcludedFromFees[account] != excluded, "Account is already the value of 'excluded'");
        _isExcludedFromFees[account] = excluded;

        emit ExcludeFromFees(account, excluded);
    }

    function isExcludedFromFees(address account) public view returns(bool) {
        return _isExcludedFromFees[account];
    }

    function updateBuyFees(uint256 _autoBuybackBurnFeeOnBuy, uint256 _marketingFeeOnBuy, uint256 _rewardFeeOnBuy) external onlyOwner {
        require(_autoBuybackBurnFeeOnBuy <= 8, "Autobuybackburn fee must be less than 8%"); 
        require(_marketingFeeOnBuy <= 8, "Marketing fee must be less than 8%"); 
        require(_rewardFeeOnBuy <= 8, "Reward fee must be less than 8%");
        require(_autoBuybackBurnFeeOnBuy + _marketingFeeOnBuy + _rewardFeeOnBuy <= 10, "Fees must be less than 10%");
        autoBuybackBurnFeeOnBuy = _autoBuybackBurnFeeOnBuy;
        rewardFeeOnBuy = _rewardFeeOnBuy;
        marketingFeeOnBuy = _marketingFeeOnBuy;
        _totalFeesOnBuy =
            autoBuybackBurnFeeOnBuy +
            marketingFeeOnBuy +
            rewardFeeOnBuy;
        emit UpdateBuyFees(
            _autoBuybackBurnFeeOnBuy,
            _marketingFeeOnBuy,
            _rewardFeeOnBuy
        );
    }

    function updateSellFees(uint256 _autoBuybackBurnFeeOnSell, uint256 _marketingFeeOnSell, uint256 _rewardFeeOnSell) external onlyOwner {
        require(_autoBuybackBurnFeeOnSell <= 8, "Autobuybackburn fee must be less than 8%"); 
        require(_marketingFeeOnSell <= 8, "Marketing fee must be less than 8%"); 
        require(_rewardFeeOnSell <= 8, "Reward fee must be less than 8%");
        require(_autoBuybackBurnFeeOnSell + _marketingFeeOnSell + _rewardFeeOnSell <= 10, "Fees must be less than 10%");
        autoBuybackBurnFeeOnSell = _autoBuybackBurnFeeOnSell;
        rewardFeeOnSell = _rewardFeeOnSell;
        marketingFeeOnSell = _marketingFeeOnSell;
        _totalFeesOnSell =
            autoBuybackBurnFeeOnSell +
            marketingFeeOnSell +
            rewardFeeOnSell;
        emit UpdateSellFees(
            _autoBuybackBurnFeeOnSell,
            _marketingFeeOnSell,
            _rewardFeeOnSell
        );
    }
    
    function changeMarketingWallet(address _marketingWallet)
        external
        onlyOwner
    {
        require(
            _marketingWallet != marketingWallet,
            "Marketing wallet is already that address"
        );
        require(
            _marketingWallet != address(0),
            "Marketing wallet cannot be the zero address"
        );
        marketingWallet = _marketingWallet;
        emit MarketingWalletChanged(marketingWallet);
    }

    function enableTrading() 
        external 
        onlyOwner {
        tradingEnabled = true;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(tradingEnabled || _isExcludedFromFees[from] || _isExcludedFromFees[to], "ERC20: trading is disabled");

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        if (antiBotEnabled) { pinkAntiBot.onPreTransferCheck(from, to, amount); }

        uint256 contractTokenBalance = balanceOf(address(this));

        bool canSwap = contractTokenBalance >= swapTokensAtAmount;

        if (canSwap && !swapping && to == uniswapV2Pair) {
            swapping = true;
            if (swapWithLimit) {
                contractTokenBalance = swapTokensAtAmount;
            }
            
            uint256 autoBuybackBurnShare = autoBuybackBurnFeeOnBuy + autoBuybackBurnFeeOnSell;
            uint256 marketingShare = marketingFeeOnBuy + marketingFeeOnSell;
            uint256 rewardShare = rewardFeeOnBuy + rewardFeeOnSell;           
            uint256 bnbShare = autoBuybackBurnShare + marketingShare + rewardShare;

            uint256 initialBalance = address(this).balance;

            if (contractTokenBalance > 0 && bnbShare > 0) {
               
                address[] memory path = new address[](2);
                path[0] = address(this);
                path[1] = uniswapV2Router.WETH();

                uniswapV2Router
                    .swapExactTokensForETHSupportingFeeOnTransferTokens(
                        contractTokenBalance,
                        0,
                        path,
                        address(this),
                        block.timestamp
                    );

                uint256 newBalance = address(this).balance - initialBalance;

                if (marketingShare > 0) {
                    uint256 marketingBNB = (newBalance * marketingShare) / bnbShare;
                    payable(marketingWallet).sendValue(marketingBNB);
                    emit SendMarketing(marketingBNB);
                }

                if (rewardShare > 0) {
                    uint256 rewardBNB = (newBalance * rewardShare) / bnbShare;
                    swapAndSendDividends(rewardBNB);  
                    emit SendDividends(rewardBNB);                  
                }

                if (autoBuybackBurnShare > 0) {
                    uint256 buybackBNB = (newBalance * autoBuybackBurnShare) / bnbShare;
                    accumulatedBuybackBNB += buybackBNB;
                    if (accumulatedBuybackBNB > bnbValueForBuyBurn) {
                        if (address(this).balance >= accumulatedBuybackBNB) {
                        buyBack(accumulatedBuybackBNB);
                        } else {
                        buyBack(address(this).balance);
                        }
                        accumulatedBuybackBNB = 0;
                    }                
                }
            }

            swapping = false;
        }

        uint256 _totalFees;
        if (((_isExcludedFromFees[from] || _isExcludedFromFees[to]) ||
                (from != uniswapV2Pair && to != uniswapV2Pair)) || swapping) {
            _totalFees = 0;
        } else if (from == uniswapV2Pair) {
            _totalFees = _totalFeesOnBuy;
        } else {
            _totalFees = _totalFeesOnSell;
        }

        if (_totalFees > 0) {
            uint256 fees = (amount * _totalFees) / 100;
            amount = amount - fees;
            super._transfer(from, address(this), fees);
        }
        
        super._transfer(from, to, amount);

        try
            dividendTracker.setBalance(payable(from), balanceOf(from))
        {} catch {}
        try dividendTracker.setBalance(payable(to), balanceOf(to)) {} catch {}

        if (!swapping) {
            uint256 gas = gasForProcessing;

            try dividendTracker.process(gas) returns (
                uint256 iterations,
                uint256 claims,
                uint256 lastProcessedIndex
            ) {
                emit ProcessedDividendTracker(
                    iterations,
                    claims,
                    lastProcessedIndex,
                    true,
                    gas,
                    tx.origin
                );
            } catch {}
        }
    }

    //=======Swap=======//
    
    function swapAndSendDividends(uint256 amount) private{
        (bool success, ) = payable(address(dividendTracker)).call{value: amount}("");

        if (success) {
            dividendTracker.distributeDividends(amount);
            emit SendDividends(amount);
        }
    } 

    function setSwapEnabled(bool _enabled) external onlyOwner {
        swapEnabled = _enabled;
        emit SwapEnabledUpdated(_enabled);
    }

    function setBNBValueForBuyBurn(uint value) public onlyOwner {
        require(value >= 1 * (10**10), "'BNBValueForBuyBurn' must be greater than 0.1");
        bnbValueForBuyBurn = value;
    }

    function buyBack(uint256 amount) internal {
        address[] memory path = new address[](2);
        path[0] = uniswapV2Router.WETH();
        path[1] = address(this);

        uniswapV2Router.swapExactETHForTokensSupportingFeeOnTransferTokens{
            value: amount
        }(0, path, DEAD, block.timestamp);
    }

    function setSwapTokensAtAmount(uint256 newAmount) external onlyOwner {
        require(
            newAmount > totalSupply() / 100000,
            "SwapTokensAtAmount must be greater than 0.001% of total supply"
        );
        swapTokensAtAmount = newAmount;
        emit SwapTokensAtAmountUpdated(newAmount);
    }
   
//=======Divivdend Tracker=======//
    function updateDividendTracker(address newAddress) public onlyOwner {
        require(newAddress != address(dividendTracker), "The dividend tracker already has that address");

        DividendTracker newDividendTracker = DividendTracker(payable(newAddress));

        require(newDividendTracker.owner() == address(this), "The new dividend tracker must be owned by the token contract");

        try newDividendTracker.excludeFromDividends(address(newDividendTracker)) {} catch {}
        try newDividendTracker.excludeFromDividends(address(this)) {} catch {}
        try newDividendTracker.excludeFromDividends(DEAD){} catch {}
        try newDividendTracker.excludeFromDividends(address(uniswapV2Router)){} catch {}
        try newDividendTracker.excludeFromDividends(address(uniswapV2Pair)){} catch {}

        emit UpdateDividendTracker(newAddress, address(dividendTracker));

        dividendTracker = newDividendTracker;
    }

    function updateGasForProcessing(uint256 newValue) public onlyOwner {
        require(newValue >= 200000 && newValue <= 500000, "gasForProcessing must be between 200,000 and 500,000");
        require(newValue != gasForProcessing, "Cannot update gasForProcessing to same value");
        emit GasForProcessingUpdated(newValue, gasForProcessing);
        gasForProcessing = newValue;
    }

    function updateMinimumBalanceForDividends(uint256 newMinimumBalance) external onlyOwner {
        dividendTracker.updateMinimumTokenBalanceForDividends(newMinimumBalance);
    }

    function updateClaimWait(uint256 claimWait) external onlyOwner {
        dividendTracker.updateClaimWait(claimWait);
    }

    function getClaimWait() external view returns(uint256) {
        return dividendTracker.claimWait();
    }

    function getTotalDividendsDistributed() external view returns (uint256) {
        return dividendTracker.totalDividendsDistributed();
    }

    function withdrawableDividendOf(address account) public view returns(uint256) {
    	return dividendTracker.withdrawableDividendOf(account);
  	}

	function dividendTokenBalanceOf(address account) public view returns (uint256) {
		return dividendTracker.balanceOf(account);
	}

    function totalRewardsEarned(address account) public view returns (uint256) {
        return dividendTracker.accumulativeDividendOf(account);
    }

	function excludeFromDividends(address account) external onlyOwner{
	    dividendTracker.excludeFromDividends(account);
	}

    function isExcludedFromDividends(address account) public view returns (bool) {
        return _isExcludedFromDividends[account];
    }

    function getAccountDividendsInfo(address account)
        external view returns (
            address,
            int256,
            int256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256) {
        return dividendTracker.getAccount(account);
    }

	function getAccountDividendsInfoAtIndex(uint256 index)
        external view returns (
            address,
            int256,
            int256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256) {
    	return dividendTracker.getAccountAtIndex(index);
    }

	function processDividendTracker(uint256 gas) external {
		(uint256 iterations, uint256 claims, uint256 lastProcessedIndex) = dividendTracker.process(gas);
		emit ProcessedDividendTracker(iterations, claims, lastProcessedIndex, false, gas, tx.origin);
    }

    function claim() external {
		dividendTracker.processAccount(payable(msg.sender), false);
    }

    function claimAddress(address claimee) external onlyOwner {
		dividendTracker.processAccount(payable(claimee), false);
    }

    function getLastProcessedIndex() external view returns(uint256) {
    	return dividendTracker.getLastProcessedIndex();
    }

    function setLastProcessedIndex(uint256 index) external onlyOwner {
    	dividendTracker.setLastProcessedIndex(index);
    }

    function getNumberOfDividendTokenHolders() external view returns(uint256) {
        return dividendTracker.getNumberOfTokenHolders();
    }
